import React, {Component} from 'react';
import './Button.css';

class Button extends Component {
  constructor(props) {
    super(props);
    this.state = {value: 'Hello'};
  }
  render() {
    return (
      <button
      type="button"
      className="btn btn-primary mr-3"
      onClick={()=>this.setState({value: 'Poop'})}
      >
        {this.state.value}
      </button>
    );  
  }
}

export default Button;
